import { StyleSheet } from "react-native";

export default StyleSheet.create({
    body: {
        display: 'flex',
        alignItems: 'center',
        height: '100vh',
    },
    header: {
        marginTop: 20,
        fontSize: 20,
        fontWeight: 'bold',
    },
    inputs:{
        alignSelf: 'center',
        justifySelf: 'center',
    }
})
